const medicationdispenseStatus = {"resourceType":"CodeSystem","id":"medicationdispense-status","meta":{"lastUpdated":"2022-05-28T12:47:40.239+10:00","profile":["http://hl7.org/fhir/StructureDefinition/shareablecodesystem"]},"text":{"status":"generated","div":"<div xmlns=\"http://www.w3.org/1999/xhtml\"><p>This code system http://terminology.hl7.org/CodeSystem/medicationdispense-status defines the following codes:</p><table class=\"codes\"><tr><td style=\"white-space:nowrap\"><b>Code</b></td><td><b>Display</b></td><td><b>Definition</b></td></tr><tr><td style=\"white-space:nowrap\">preparation<a name=\"medicationdispense-status-preparation\"> </a></td><td>Preparation</td><td>The core event has not started yet, but some staging activities have begun (e.g. initial compounding or packaging of medication). Preparation stages may be tracked for billing purposes.</td></tr><tr><td style=\"white-space:nowrap\">in-progress<a name=\"medicationdispense-status-in-progress\"> </a></td><td>In Progress</td><td>The dispensed product is ready for pickup.</td></tr><tr><td style=\"white-space:nowrap\">cancelled<a name=\"medicationdispense-status-cancelled\"> </a></td><td>Cancelled</td><td>The dispensed product was not and will never be picked up by the patient.</td></tr><tr><td style=\"white-space:nowrap\">on-hold<a name=\"medicationdispense-status-on-hold\"> </a></td><td>On Hold</td><td>The dispense process is paused while waiting for an external event to reactivate the dispense.  For example, new stock has arrived or the prescriber has called.</td></tr><tr><td style=\"white-space:nowrap\">completed<a name=\"medicationdispense-status-completed\"> </a></td><td>Completed</td><td>The dispensed product has been picked up.</td></tr><tr><td style=\"white-space:nowrap\">entered-in-error<a name=\"medicationdispense-status-entered-in-error\"> </a></td><td>Entered in Error</td><td>The dispense was entered in error and therefore nullified.</td></tr><tr><td style=\"white-space:nowrap\">stopped<a n